import React, { useState, useEffect } from "react"
import axios from "axios";
/* components and style */
import MainSecondHeder from "../components/MainSecoundHeder";
import Button from "../components/Button";
export default function ListUser() {
    const [listUser, setUser] = useState([]);
    const [role, setRole] = useState("admin");
    const [views, setViews] = useState("")
    const userList = () => {
        axios.post("http://127.0.0.1:8080/user/all")
            .then((res) => {
                setUser(res.data)
            })
    }

    const tableName = () => {
        if (role === "employee") {
            return "Lista Pracowników"
        } else if (role === "client") {
            return "Lista Klijetów"
        } else {
            return "Administratorzy strony"
        }
    }
    useEffect(() => {
        userList()
    }, [])

    if (views === "client") {
        return (
            <div>
                <MainSecondHeder>Lista Użytkowników</MainSecondHeder>
                <div>
                    <Button onClick={() => {
                        setViews("")
                        setRole('admin')
                    }}>Administratorzy</Button>
                    <Button onClick={() => {
                        setViews("")
                        setRole('employee')
                    }}>Pracownicy</Button>
                    <Button onClick={() => {
                        setViews("client")
                        setRole('client')
                    }}>Klięci</Button>
                </div>
                <table>
                    <thead>
                        <tr>
                            <td><p>{tableName()}</p> </td>
                        </tr>
                        <tr>
                            <td>Imię</td>
                            <td>Numer Kontaktowy</td>
                            <td>Emial</td>
                            <td>PESEL</td>
                            <td>Akcje</td>
                        </tr>
                    </thead>
                    <tbody>
                        {listUser.map((user) => {
                            if (user.role === role) {
                                return (
                                    <tr key={user._id}>
                                        <td>
                                            {user.personalData.firstName}
                                        </td>
                                        <td>{user.phoneNumber}</td>
                                        <td>{user.email}</td>
                                    </tr>
                                );
                            }
                            return null;
                        })}
                    </tbody>
                </table>
            </div>

        )
    }
    return (
        <div>
            <MainSecondHeder>Lista Użytkowników</MainSecondHeder>
            <div>
                <Button onClick={() => {
                    setViews("")
                    setRole('admin')
                }}>Administratorzy</Button>
                <Button onClick={() => {
                    setViews("")
                    setRole('employee')
                }}>Pracownicy</Button>
                <Button onClick={() => {
                    setViews("client")
                    setRole('client')
                }}>Klięci</Button>
            </div>
            <table>
                <thead>
                    <tr>
                        <td><p>{tableName()}</p> </td>
                    </tr>
                    <tr>
                        <td>Imię</td>
                        <td>Numer Kontaktowy</td>
                        <td>Emial</td>
                        <td>Akcje</td>
                    </tr>
                </thead>
                <tbody>
                    {listUser.map((user) => {
                        if (user.role === role) {
                            return (
                                <tr key={user._id}>
                                    <td>
                                        {user.personalData.firstName}
                                    </td>
                                    <td>{user.phoneNumber}</td>
                                    <td>{user.email}</td>
                                </tr>
                            );
                        }
                        return null;
                    })}
                </tbody>
            </table>

        </div>


    )
}
